r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;For Gir Interpretation Zone Devalia Visitors, Information will be available at Gir Interpretation Zone, Devalia.\r\n</span></p>\r\n						</li>\r\n						<li>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;At the time of online booking for each and every traveller, ID Proof like number/type etc should be provided as in\r\n</span></p>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">original Id proof. Bookings with incomplete or incorrect ID proof will be considered invalid. No permit will be issued\r\n</span></p>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">against such booking and No refund will be made to the person making such booking.\r\n</span></p>\r\n						</li>\r\n						<li>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;At the time of collecting permit, presenting the Original IDs for every persons (same given during E-Booking) is\r\n</span></p>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">compulsary, without the Original IDs, no entry shall be permitted.\r\n</span></p>\r\n						</li>\r\n						<li>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;Permit issuing authority reserves the right of cancellation of e-permits.\r\n</span></p>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\"><b>COVID 19 Safety Instructions for Visitors\r\n</b></span></p>\r\n						</li>\r\n					</ul>\r\n					<ul style=\"list-style-type: none\">\r\n						<li>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;Avoid visit if you have any symptoms of COVID-19.\r\n</span></p>\r\n						</li>\r\n						<li>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;Persons above 65 years of age, persons with comorbidities, pregnant women and children below the age of 10\r\n</span></p>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">years are advised to stay at home.\r\n</span></p>\r\n						</li>\r\n						<li>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;Visitors are advised to carry the sanitizers and use them as and when required.\r\n</span></p>\r\n						</li>\r\n						<li>\r\n							<p><span style=\"font-size: 12.000000pt; font-family: \'Elysio\'\">. &nbsp;Its better to avoid touching surfaces as much as possible.&nbsp;</span></p>\r\n						</li>\r\n					</ul>\r\n				</div>\r\n			</div>\r\n		</div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>','2023-03-27 17:07:43','2023-03-28 12:45:11'),(7,'privacy-policy',NULL,NULL,NULL,'<div class=\"informationpage\">\r\n    <div class=\"container\">\r\n        <h1>Privacy <span>Policy</span> <img src=\"/frontend/image/icons/bus.png\" alt=\"bus-icon\" class=\"busicon\"></h1>\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-12 col-12\">\r\n                <div class=\"privacy\">\r\n                    <div class=\"accordion\" id=\"accordion\">\r\n                        <div class=\"card\">\r\n                          <div class=\"card-header\" id=\"headingOne\">\r\n                              \r\n<button class=\"btn btn-link btn-block text-left btn-header-link\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseOne\" aria-expanded=\"true\" aria-controls=\"collapseOne\">\r\n                                Collection Of Personal Information:</button></div><div id=\"collapseOne\" class=\"show collapse in\" aria-labelledby=\"headingOne\" data-parent=\"#accordion\" aria-expanded=\"true\" style=\"\"><div class=\"card-body\"><p><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 16px;\"><br></span></p><p><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 16px;\">We may look for your name and email address. When you book a tour or send a query, you are no more mysterious to us and you can exploit our online offerings. Wherever we gather individual data, we try to incorporate a connection to this Privacy Policy on that page. When you are on our site and are requested individual data, you are offering that data to only us, unless it is particularly expressed something else. It would be ideal if you know that our publicists or sites that have joins on our site may gather by and by identifiable data about you. This protection articulation does not cover the data practices of those sites connected from and to us.</span><br></p>\r\n                            </div>\r\n                          </div>\r\n                        </div>\r\n                        <div class=\"card\">\r\n                          <div class=\"card-header\" id=\"headingTwo\">\r\n                              <button class=\"btn btn-link btn-block text-left btn-header-link collapsed\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseTwo\" aria-expanded=\"false\" aria-controls=\"collapseTwo\">\r\n                                Use Of Personal Information:\r\n                              </button>\r\n                          </div>\r\n                          <div id=\"collapseTwo\" class=\"collapse\" aria-labelledby=\"headingTwo\" data-parent=\"#accordion\">\r\n                            <div class=\"card-body\">\r\n                              <p>Our essential objective in gathering individual information is to give you, with a modified affair on our site. This incorporates personalization services, intuitive correspondences and numerous different services, the majority of which come totally allowed to you. We may, every now and then, send you email with respect to its new items and services. Moreover, on the off chance that you show upon enlistment that you are keen on getting offers or data from us, we may at times send you coordinate sends about items and services that we feel might hold any importance with you. Just we/our operators (under classification understandings), will send you these immediate mailings and just on the off chance that you don\'t protest these offers. On the off chance that you don\'t wish to get such mailing, generous advise us while enlisting or whenever by altering your enrolment data.\r\n\r\n.</p>\r\n                            </div>\r\n                          </div>\r\n                        </div>\r\n                        <div class=\"card\">\r\n                          <div class=\"card-header\" id=\"headingThree\">\r\n                            <h2 class=\"mb-0\">\r\n                              <button class=\"btn btn-link btn-block text-left btn-header-link\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThree\" aria-expanded=\"true\" aria-controls=\"collapseThree\">\r\n                                Sharing Of Information:</button></h2><h2 class=\"mb-0\"><button class=\"btn btn-link btn-block text-left btn-header-link\" type=\"button\" data-toggle=\"collapse\" data-target=\"#collapseThree\" aria-expanded=\"true\" aria-controls=\"collapseThree\">\r\n                              </button>\r\n                            </h2>\r\n                          </div>\r\n                          <div id=\"collapseThree\" class=\"collapse in\" aria-labelledby=\"headingThree\" data-parent=\"#accordion\" aria-expanded=\"true\" style=\"\">\r\n                            <div class=\"card-body\">\r\n                              <p>When in doubt, we should won\'t reveal or share any of your own data with the exception of when we have particularly acquired your authorization or under unique circumstances, for example, when we put stock in accordance with some basic honesty that the law requires it or as allowed as far as this arrangement.\r\n\r\n</p>\r\n                            </div>\r\n                          </div>\r\n                        </div>\r\n                      </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>','2023-03-27 17:07:43','2023-03-28 12:17:01'),(8,'cancellation-policy',NULL,NULL,NULL,'<div class=\"informationpage\">\r\n    <div class=\"container\">\r\n        <h1>Cancellation <span>Policy</span> <img src=\"/frontend/image/icons/bus.png\" alt=\"bus-icon\" class=\"busicon\"></h1>\r\n        <div class=\"row\">\r\n            <div class=\"col-sm-12 col-12\">\r\n                <div class=\"tremsinfo\">\r\n                    <p>In case if you are postponing or cancelling your tour/travel due to any unavoidable reasons, you must intimate us in writing. Please make it sure that cancellation charges would be effective from the date we receive your mail in writing. Following cancellation policy would be applicable:</p>\r\n                    <p>\r\n                        <img src=\"/frontend/image/icons/check-mark.png\" alt=\"check\">\r\n                        <span><b>Bus Safari Amount is Non Refundable.</b></span></p>\r\n                    <p>\r\n                        <img src=\"/frontend/image/icons/check-mark.png\" alt=\"check\">\r\n                        <b>Important Note:</b>In case your safari is not booked due to reasons like technical error or non-availability of seat, we will refund the whole amount in your given bank account. The same would be communicated accordingly..\r\n                    </p>\r\n                    <p>\r\n                        <img src=\"/frontend/image/icons/check-mark.png\" alt=\"check\">\r\n                        <b>In case of peak season - </b>weekends or weekdays (Holi, Diwali, X\'Mas &amp; New Year) hotel/Forest Lodges bookings separate cancellation policy is applicable (which would be advised as and when required). \r\n                    </p>\r\n                    <p>\r\n                        <img src=\"/frontend/image/icons/check-mark.png\" alt=\"check\">\r\n                        <b>Our Liabilities and Limitations :</b> Please note that after you Finalize the tour/service cost and in case if there are any hikes in permit fees of safaris/museums, taxes, fuel cost or guide charges decided by the Govt of India, the same would be charged as extra.  \r\n                    </p>\r\n                    <p>\r\n                        <img src=\"/frontend/image/icons/check-mark.png\" alt=\"check\">\r\n                        <span>Force Majeure events, strikes, fairs, festivals, weather conditions, traffic problems, overbooking of hotels, closure of / entry restrictions at a place of visit, etc. While we will do our best to make suitable alternate arrangements, we would not be held liable for any refunds/compensation claims arising out of this. </span>\r\n                    </p>\r\n                    \r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>','2023-03-27 17:07:43','2023-03-28 12:36:10');
